import React from 'react'
import ReactDOM from 'react-dom'
import Course from './components/Course'







const App = () => {
  const courses = [
    {
      name: 'Half Stack -sovelluskehitys',
      id: 1,
      parts: [
        {
          name: 'Reactin perusteet',
          exercises: 10,
          id: 1
        },
        {
          name: 'Tiedonvälitys propseilla',
          exercises: 7,
          id: 2
        },
        {
          name: 'Komponenttien tila',
          exercises: 14,
          id: 3
        }
      ]
    },
    {
      name: 'Node.js',
      id: 2,
      parts: [
        {
          name: 'Routing',
          exercises: 3,
          id: 1
        },
        {
          name: 'Middlewaret',
          exercises: 7,
          id: 2
        }
      ]
    }
  ]

  const course  = courses.map(course => <Course key={course.id} name={course.name} parts={course.parts}/>)
  console.log(course)

  return (
    <div>
     <>{course}</>
    </div>
  )
}

ReactDOM.render(<App/>, document.getElementById('root'))
